function showErrors(b){var c=b.errors;var e=Object.keys(c);$(".has-error").find(".help-block").remove();$(".has-error").removeClass("has-error");for(var d=0;d<e.length;d++){var f=$("#"+e[d]);var a=f.closest(".form-group");$(a).find(".help-block").remove();$(a).append('<div class="help-block">'+c[e[d]]+"</div>");$(a).addClass("has-error")}}function blockUI(e,c){if(c==undefined){c="Loading..."}var a='<div class="loading-message"><img src="'+assetsPath+'images/bars.svg" align=""></div>';if(e!=undefined){var b=$(e);var d=false;if(b.height()<=($(window).height())){d=true}b.block({message:a,baseZ:1000,centerY:d,css:{top:"10%",border:"0",padding:"0",backgroundColor:"none"},overlayCSS:{backgroundColor:"#555",opacity:0.05,cursor:"wait"}})}else{$.blockUI({message:a,baseZ:1000,css:{border:"0",padding:"0",backgroundColor:"none"},overlayCSS:{backgroundColor:"#555",opacity:0.05,cursor:"wait"}})}}function unblockUI(a){if(a==undefined){$.unblockUI()}else{$(a).unblock({onUnblock:function(){$(a).css("position","");$(a).css("zoom","")}})}};